import React, { Component } from 'react';

class UrlForm extends Component {
  state = {
    url: ''
  }
  handleChange = (e) => {
    this.setState({
      url: e.target.url
    })
  }
  render() {
    return (
      <form>
        <input
          placeholder="write youtube url"
          onChange={this.handleChange}
        />
        <button type="submit">rearrange</button>
      </form>
    );
  }
}

export default UrlForm;
